import React from "react";
import Card from "../card";

const Times = (props) => {
    return(
        <section style={{backgroundColor: props.corSecundaria}} className="p-12 text-center ">
           <h3 className="p-3 m-3 font-bold">{props.nome}</h3>
           <div className="flex justify-around flex-wrap gap-3">
            {props.atletas.map(atleta => 
                <Card key={atleta.nome} 
                    nome={atleta.nome} 
                    cargo={atleta.cargo} 
                    imagem={atleta.imagem}
                    titularReserva={atleta.titularReserva}
                    atletaRemove={atleta}
            />)}

           </div>
        </section>
    )
}
export default Times;
